window.bookSummaryJSON = "<p><b><i>Fated mates aren't always an absolute.</i></b><br> <br> <b>Leena</b><br> I'm a survivor.<br> Between foster care, handsy step-siblings, and a mountain of toxic ex-boyfriends, I have to be.<br> After barely escaping my last loser, I was attacked in a way I didn't know possible.<br> I should've died.<br> Fate has other plans.<br> Now, I'm forced into a life surrounded by things that go bump in the night, where fairy tales and mythical creatures are real. My mere existence has attracted an entire supernatural world.<br> Both good and bad want to own me, but the only person I belong to is him.<br> <br> <b>Declan</b><br> If someone told me years ago I was destined to lose my sanity because of an unbreakable curse, I would've laughed in their face. I was human, and my life wasn't complicated.<br> An animal attack changed that. It changed everything.<br> The beast killed my family and transformed me into this thing.<br> I spend my time protecting mankind from the worst of us--the feral wolf shifters who've succumbed to madness.<br> Still, he got to her, and I was too late.<br> Or so I believed.<br> I was given a second chance, and this time, failure isn't an option. I'll keep Leena safe and protected the one way I know how.<br> By making her mine.</p>"; 
